                font-weight: 600;
                background-color: $white;
                color: $black;
                cursor: pointer;

                transition: all .5s;

                &:hover {
                    color: $white;
                    background-color: $black;
                    border: 0.125em solid $white;

                }
            }
            
        }
    }

