        font-size: 11px;
    }

    .home {
        .text-div {
            font-size: 11px;

            .title {
                line-height: 3.5rem;

            }

            .title2 {
                width: 90%;
            }
        }
    }

    .shop {

        .title-div {
            font-size: 11px;
        }

        .grid-container {
            font-size: 8px;
        }
    }
}

