    html, body {
        font-size: 10px;
    }

    .home {
        .text-div {
            font-size: 10px;

            .title {
                line-height: 3rem;

            }

            .title2 {
                width: 90%;
            }
        }
    }

    .shop {
        padding: 8em 1em 20em;

        .title-div{
            font-size: 9px;
        }
        .grid-container{
            font-size: 7.5px;

            .details-button {
                width: 50%;
            }
        }
    }

    .footer {
        font-size: 8px;

        .form-div {
            form {
                .submit {
                    font-size: calc($regular - .3em);
                    border: 1px solid $white;
                }
            }
        }
    }
}

@media (max-width: 400px) {
    html, body {
        font-size: 8px;
    }

    .nav-bar {
        padding: 0 20px;

    }

    .home {
        .text-div {
            font-size: 8px;

            .title {
                line-height: 2.5rem;

            }

            .title2 {
                width: 90%;
                line-height: 1.3rem;
            }
        }
    }
}

